We will not stop...

Rich in humble and hardworking personality and Minister of State in the Government of Uttar Pradesh, Mr. Shri Sanjay Singh Gangwar ji, wish you a very Happy Birthday.

Praying to Lord Shri Ram ji that you live long and always be healthy and happy.

@SanjaySinghmla

Rich in a simple-hearted and hardworking personality, former Chief Minister of Maharashtra and Union Cabinet Minister, Mr. Shri Narayan Tatu Rane ji, wish you a very Happy Birthday.

Praying to Lord Shri Ram ji that you live long and always be healthy and happy.

@MeNarayanRane

Rich in simple and gentle personality and mother of Chhattisgarh. Governor Ms. Anusuiya Uikey ji, Hearty congratulation and best wish to you on your birthday.

Praying to Lord Shri Ram ji that you live long and always be healthy and happy.

